import React from 'react';
import './App.css';
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom';
import SearchRoot from './Components/SearchRoot';
import TeamStatistics from './Components/Statistics/TeamStatistics';
import { Container, Row } from 'react-bootstrap';

class App extends React.Component {
  render() {
    return (
      <Container fluid="true">
        <Row>
            <Container fluid="true" className="navbar navbar-expand-lg" style={{display: "flex", flexDirection: "row"}}>

              <h2>Search</h2>
              <h2>Enter Data</h2>
            </Container>
        </Row>
        <Row style={{marginTop: '1em'}}>
          <Router>
            <Switch>
            <Route exact path="/">
                <div>
                <Link to="/search">Go To Search!</Link>
                </div>
              </Route>
              <Route path="/search">
                <SearchRoot />
              </Route>
              <Route path="/teams/:teamNumber" component={TeamStatistics}>
              </Route>
            </Switch>
          </Router>
        </Row>

        </Container>
    )
  }
}

export default App;
